import { Card } from 'react-bootstrap'; 

function Home(){
    return (

        <Card
            bgcolor="primary"
            header="Welcome to BadBank"
        >
            <Card.Header> BadBank! </Card.Header>
            <Card.Body>
                <Card.Title> Welcome to BadBank! </Card.Title>
                <Card.Text> Let us help you with all your banking needs. </Card.Text>
            </Card.Body>
            <Card.Img src='./bank.jpg' /> 
        </Card>
    );
}

export default Home;
